<!DOCTYPE html>
<html>
    <head>
        <title>Dais API v1</title>

        <style>
            body {
                margin: 0;
                padding: 0;
                width: 100%;
                height: 100%;
                color: #fff;
                font-weight: 100;
                background-color: #212425;
                font-family: sans-serif;
            }

            .container {
                text-align: center;
                margin: 15% auto 0;
            }

            .content {
                text-align: center;
                display: inline-block;
            }

            .title {
                font-size: 44px;
                margin-bottom: 40px;
                color: #666;
            }

            .quote {
                font-size: 24px;
            }

            hr {
                margin-top: 20px;
                margin-bottom: 20px;
                border: 0;
                border-top: 1px solid #000;
                border-bottom: 1px solid #313131;
                clear: both;
                -moz-box-sizing: content-box;
                box-sizing: content-box;
                height: 0;
            }

        </style>
    </head>
    <body>
        <div class="container">
            <div class="content">
                <img src="data:image/png;base64,"/>
                <hr>
                <div class="title">Dais API v1</div>
            </div>
        </div>
    </body>
</html>
